  attribute C_EXT_RST_WIDTH : integer;
  attribute C_EXT_RST_WIDTH of cpu_proc_sys_reset : entity is 4;
  attribute C_FAMILY : string;
  attribute C_FAMILY of cpu_proc_sys_reset : entity is "artix7";
  attribute C_NUM_BUS_RST : integer;
  attribute C_NUM_BUS_RST of cpu_proc_sys_reset : entity is 1;
  attribute C_NUM_INTERCONNECT_ARESETN : integer;
  attribute C_NUM_INTERCONNECT_ARESETN of cpu_proc_sys_reset : entity is 1;
